&lt;p style=&quot;text-align:justify&quot;&gt;&lt;strong&gt;Parmal boiled rice:&lt;/strong&gt;&lt;/p&gt;

&lt;p style=&quot;text-align:justify&quot;&gt;Parmal boiled rice, also called converted rice, is partially pre-cooked in its inedible husk before eating. That&amp;#39;s&amp;nbsp;why it changes the color of rice to a light yellow or amber, which differs from the pale, white color of regular rice. It has a higher vitamin compared to unenriched, regular white rice.&lt;br /&gt;
&amp;nbsp;&lt;/p&gt;

&lt;p style=&quot;text-align:justify&quot;&gt;&lt;strong&gt;Biryani Rice:&lt;/strong&gt;&lt;/p&gt;

&lt;p style=&quot;text-align:justify&quot;&gt;Biryani rice is a type of rice common in Indian cuisine. Available in both white and brown varieties. It is well known for its nutty flavor and pleasing aroma. Biryani rice is typically high in carbs and micronutrients like thiamine, folate, and selenium.&lt;br /&gt;
&amp;nbsp;&lt;/p&gt;

&lt;p style=&quot;text-align:justify&quot;&gt;&lt;strong&gt;Chura or Poha:&lt;/strong&gt;&lt;/p&gt;

&lt;p style=&quot;text-align:justify&quot;&gt;Chura is processed from rice, made with flatting the rice. Chura is also known as poha, has all sources of energy that normal rice has.&lt;br /&gt;
It is a common healthy breakfast or snack that is taken by Indian people in the form of poha, mixture, dahi chura, etc.&lt;br /&gt;
&amp;nbsp;&lt;/p&gt;

&lt;p&gt;Basmati Chura or Poha&lt;/p&gt;

&lt;p&gt;Basmati Chura is processed from rice, made with flatting the rice. Chura is also known as poha, has all sources of energy that normal rice has.&lt;br /&gt;
It is a common healthy breakfast or snack that is taken by Indian people in the form of poha, mixture, dahi chura, etc.&lt;/p&gt;

&lt;p style=&quot;text-align:justify&quot;&gt;&lt;strong&gt;Gur:&lt;/strong&gt;&lt;/p&gt;

&lt;p style=&quot;text-align:justify&quot;&gt;Jaggery is a traditional sweetener made by evaporating raw sugarcane juice without separating the molasses from the crystals. The common name in India is &amp;quot; Gur &amp;quot;. It is softer and has a lot of nutritious content. It contains trace minerals and vitamins which makes it a truly healthy alternative sweetener. It can consume directly or can be used in alternative to sugar.&lt;br /&gt;
Jaggery produces heat in the body, which is why generally people consume it in winters. One of the most well-known benefits of jaggery is its ability to purify the blood. Jaggery also helps increase the total count of hemoglobin in the blood.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Sulphur free sugar:&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;Refined Sulphur free sugar can be put to a number of uses in daily routine.&lt;br /&gt;
It is a common product in an everyday product that is used to sweeten tea, coffee, and milk or whipping up tasty desserts. Also, you can use sugar for cooking purposes and for creating syrup as well.&lt;/p&gt;

&lt;p style=&quot;text-align:justify&quot;&gt;&lt;strong&gt;Kaju or Cashew:&lt;/strong&gt;&lt;br /&gt;
Nuts and seeds are considered an antioxidant powerhouse, and cashews are no exception. Cashews are low in sugar and rich in fiber, heart-healthy fats, and plant protein. They&amp;rsquo;re also a good source of copper, magnesium, and manganese &amp;mdash; nutrients important for energy production, brain health, immunity, and bone health.&lt;br /&gt;
&amp;nbsp;&lt;/p&gt;

