Popular as a fasting food, its health benefits are superior to those of dry fruits such as almonds and walnuts, some of the health benefits of makhana are: It&amp;#39;s a good source of protein, carbohydrates, fiber, magnesium, potassium, phosphorus, iron and zinc. They are low in cholesterol, fat, and sodium. It is Good for Blood Pressure and Diabetes. It is good as a natural remedy to deal with your stress.&lt;/p&gt;

